import React from 'react';
import { Add, Sub, Mul, Div } from './Heading';

function App() {
  return (
    <>
      <ul>
        <li>{Add(3, 5)}</li>
        <li>{Sub(3, 5)}</li>
        <li>{Mul(3, 5)}</li>
        <li>{Div(3, 5)}</li>
      </ul>
    </>
  );
}

export default App;
